**Frontend (src/App.js)**
```jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleAddData = () => {
    axios.post('/api/data', { name: 'John Doe', age: 30 })
      .then(response => {
        setData([...data, response.data]);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item._id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <button onClick={handleAddData}>Add Data</button>
    </div>
  );
}

export default App;
```
**Backend (app.js)**
```javascript
const express = require('express');
const app = express();
const mongoose = require('mongoose');
const bodyParser = require('body-parser');

mongoose.connect('mongodb://localhost/my-app', { useNewUrlParser: true, useUnifiedTopology: true });

app.use(bodyParser.json());

const dataSchema = new mongoose.Schema({
  name: String,
  age: Number
});

const Data = mongoose.model('Data', dataSchema);

app.get('/api/data', (req, res) => {
  Data.find().then(data => res.json(data));
});

app.post('/api/data', (req, res) => {
  const data = new Data(req.body);
  data.save().then(() => res.json(data));
});

app.listen(3001, () => {
  console.log('Server listening on port 3001');
});
```
**Build and Deploy**

To build the React app, run:
```bash
npm run build
```
This will create a `build` folder in the root of the project.

To deploy the app, you can use a service like Vercel or Netlify. Here are the steps:

**Vercel**

1. Create a new Vercel project and link it to your GitHub repository.
2. In the Vercel dashboard, click on "New Project" and select "Create a new project from a Git repository".
3. Select your GitHub repository and click "Create Project".
4. In the Vercel dashboard, click on "Settings" and select "Environment Variables".
5. Add the following environment variables:
	* `MONGODB_URI`: `mongodb://localhost/my-app`
	* `PORT`: `3001`
6. Click "Save" to save the environment variables.
7. In the Vercel dashboard, click on "Build & Deploy" and select "Deploy to Vercel".
8. Wait for the build and deployment process to complete.

